ReactDOM.render(
  <table>
    <tr>
      <th>Brand</th>
      <th>Top Speed</th>
      <th>Top Color</th>
    </tr>
    <tr>
      <td>{Cars.model}</td>
      <td>{Cars.speedStats[1]}</td>
      <td>{Cars.colourByPopularity[0]}</td>
    </tr>
    <tr>
      <td>{Cars.model}</td>
      <td>{Cars.speedStats[1]}</td>
      <td>{Cars.color[0]}</td>
    </tr>
  </table>,
  document.getElementById("root")
);
